ine)\n    if match is None:\n        # Optionally, you can change this to just ignore if each line of data is not critical.\n        #   Corrupt data is common when writing to files.\n        raise Exception(\"Invalid logline: %s\" % logline)\n    return Row(\n        ipAddress    = match.group(1),\n        clientIdentd = match.group(2),\n        userId       = match.group(3),\n        dateTime     = match.group(4),\n        method       = match.group(5),\n        endpoint     = match.group(6),\n        protocol     = match.group(7),\n        responseCode = int(match.group(8)),\n        contentSize  = long(match.group(9)))","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\"></div>","arguments":{},"plotOptions":null},"errorSummary":null,"error":null,"startTime":1.440450906907E12,"submitTime":1.440450906776E12,"finishTime":1.440450906956E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":null,"commentThread":[],"commentsVisible":false,"parentHierarchy":null,"diffInserts":null,"diffDeletes":null,"globalVars":{},"latestUser":"vida","iPythonMetadata":null,"nuid":"c5228eb4-6bbd-49d1-ba6b-35188230f90c"},{"version":"CommandV1","origId":3721,"guid":"cdcc4be5-6ddc-4f52-a2b1-d736dd2a8c8d","subtype":"command","commandType":"auto","position":2.9375,"command":"%md\n\n### **Step 3:** Load the log lines into Spark.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"startTime":0.0,"submitTime":1.427924707265E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":null,"commentThread":[],"commentsVisible":false,"parentHierarchy":null,"diffInserts":null,"diffDeletes":null,"globalVars":{},"latestUse
